import './List.css'
import capitalizeFirstLetter from '../utils/helpers.js'

const List = ({ listName, listItems }) => {
    return ( 
        <div className='list'>
            <h2>{listName}</h2>
            <ul>
                {listItems && listItems.map(item => <li>{item.stat.name}: {item.base_stat}</li>)}
            </ul>
        </div>
     );
}

export default List;
